preference.preference_description:
Specifies the colors used in the Line Balancing Chart view in the Manufacturing Process Planner application.

VALID VALUES:
If one entry is invalid (the color is not specified, the specified value is invalid, etc.), the whole entry will be discarded and the application will be using a default value specific to each element.
The format for each value is the following: "Type:color-type; Class:class-name; Foreground:rgb-value; Background:rgb-value; LineColor:rgb-value; TextColor:rgb-value;"
where:

*Type: Specifies the case for which the subsequently defined coloring scheme will apply. This is a mandatory keyword.
Valid values are:
Normal: color scheme for normal objects.
Selection: color scheme for selected objects.
Highlight: color scheme for highlighted objects, the negative values of the "TimesPerBar", and the tooltip entries marking a sub-group.
LimitViolation: color scheme for objects above the capacity line.
Emphasized: color scheme for operations with probability strictly lower than 100%.
EmphasizedLimitViolation: color scheme for operations with probability strictly lower than 100% and above the capacity line.
Dimmed: color scheme for separation lines for sub-group entries.

*Class: Specifies the class type of the objects. This keyword is mandatory.
Valid values are:
Operation: boxes displayed in the bar area representing operations
Station: boxes displayed on the axis area representing stations
CycleTimeLines: horizontal lines representing the multiple of the cycle time.
CapacityLine: a line shows the capacity of each station.
AverageLine: an horizontal line shows the height of the average work content over the different product variants.
TimesPerBar: the time values shown on top of each bar.
Overlay: a box showing the maximum and minimum work contents of all product variants.
Tooltip: the tooltip area including the fill colors and color of text.
TooltipSeparator: the lines between tooltip entries.


*Foreground and Background: Specifies the RGB (red, green, blue) code of the fill color for boxes associated to Operation and Station classes.
This field is ignored for the color types Grid and LimitLine, and can be left blank.
Valid values are the RGB code using the comma (,) as a separator.

*LineColor: Specifies the RGB code for the color of lines. For Grid and LimitLine color types, this is the line color. For all the other color types, this is the border color.
Valid values are the RGB code using the comma (,) as a separator.

*TextColor:  Specifies the RGB code for the text color.
Valid values are the RGB code using the comma (,) as a separator.

*Default Values: In the following, all possible combinations of types, classes and the default color values are listed. Any combination of type and class which is not listed here is an error and will be ignored by the Chart View.
